B.act=new A.be("-La quota di partecipazione sar\xe0 di 20\u20ac. Compresa nel prezzo dell'iscrizione ci sar\xe0 anche la maglia ufficiale del torneo che obbligatoriamente deve essere messa ogni partita",null,null,null,null,null,B.S,null,null,null)
B.acl=new A.be("-Non saranno tollerati in alcun modo eccessi di foga o insulti pena espulsione diretta (3 minuti fuori dal campo)",null,null,null,null,null,B.S,null,null,null)
B.acT=new A.be("-In caso uno o pi\xf9 giocatori dei 7 che si sono iscritti inizialmente non possono partecipare ad una partita, deve essere comunicato il cambio al massimo 24 ore prima dell'inizio del match",null,null,null,null,null,B.S,null,null,null)
